package com.example.coursework.ui.viewmodel;

import androidx.lifecycle.LiveData;
import androidx.lifecycle.MutableLiveData;
import androidx.lifecycle.ViewModel;

import com.example.coursework.ui.entities.BakeryProduct;
import com.example.coursework.ui.entities.BakeryProduction;
import com.example.coursework.ui.entities.Ingredient;

import java.util.ArrayList;
import java.util.List;

public class CookingViewModel extends ViewModel {

    private final MutableLiveData<List<BakeryProduction>> _bakeryProductions = new MutableLiveData<>(new ArrayList<>());
    public LiveData<List<BakeryProduction>> bakeryProductions = _bakeryProductions;

    public CookingViewModel() {
        List<BakeryProduction> bakeryProductions = new ArrayList<>();
        List<Ingredient> ingredients = new ArrayList<>();
        for (int j = 0; j < 3; j++) {
            ingredients.add(new Ingredient(j, "Ingredient " + j, "г", 1.0 + j));
        }
        BakeryProduct product = new BakeryProduct(
                12,
                "Хлеб",
                "Хлеб на закваске",
                50,
                new ArrayList<>(),
                "data:image/png;base64,"
        );
        for (int i = 0; i < 30; i++) {
            bakeryProductions.add(new BakeryProduction(i, product, 10, 1715530000000L, 1715530000000L));
        }
        _bakeryProductions.setValue(bakeryProductions);
    }



    public void addProduction(int productId, int count, long startTime, long endTime){
        List<BakeryProduction> bakeryProductions = _bakeryProductions.getValue();
        if (bakeryProductions != null) {
            bakeryProductions.add(new BakeryProduction(
                    bakeryProductions.size(),
                    new BakeryProduct(
                            12,
                            "Хлеб",
                            "Хлеб на закваске",
                            50,
                            new ArrayList<>(),
                            "data:image/png;base64,"
                    ),
                    count,
                    startTime,
                    endTime
            ));
        }
        _bakeryProductions.setValue(bakeryProductions);

    }
}